import React from 'react';
import './AboutUs.css';

const AboutUs = () => {
    return (
        <div className="about-us">
            <h1>About Us</h1>
            <section className="what-we-do">
                <h2>What We Do</h2>
                <p>ClasherStation is your ultimate destination for the latest gaming consoles, games, and accessories. We offer a curated selection of products that cater to both casual and hardcore gamers.</p>
            </section>
            <section className="how-we-do">
                <h2>How We Do It</h2>
                <p>At ClasherStation, we pride ourselves on providing top-notch customer service, exclusive collections, and high-quality products. Our team works tirelessly to ensure that our customers have access to the best gaming gear on the market.</p>
            </section>
        </div>
    );
};

export default AboutUs;
